import React from 'react';
import "bootstrap/dist/css/bootstrap.min.css";
import { BrowserRouter as Router, Route } from 'react-router-dom';

// Included components
import Navbar from "./components/navbar.component";
import CreateGoalieRequest from "./components/create-goalie-request.component";
import EmailDevs from "./components/email-devs.component";
import CreateUser from "./components/create-user.component";

function App() 
{
  return (
    <Router>
      <div className="container">
        <Navbar />
        <br/>
        <Route path="/" exact component={CreateGoalieRequest} />
        <Route path="/create" component={CreateUser} />
        <Route path="/emaildevs" component={EmailDevs} />
        </div>
    </Router>
  );
}

export default App;
